/*
Auto-generated by: https://github.com/pmndrs/gltfjsx
Command: npx gltfjsx@6.1.4 scene.gltf --types, -t
Author: 1-3D.com (https://sketchfab.com/1-3D.com)
License: CC-BY-SA-4.0 (http://creativecommons.org/licenses/by-sa/4.0/)
Source: https://sketchfab.com/3d-models/folded-clothes-ca4932da28ea495db1f9969807d9c107
Title: Folded clothes
*/

import * as THREE from "three";
import { useGLTF } from "@react-three/drei";
import { GLTF } from "three-stdlib";

type GLTFResult = GLTF & {
  nodes: {
    Object_2: THREE.Mesh;
    Object_3: THREE.Mesh;
    Object_4: THREE.Mesh;
    Object_5: THREE.Mesh;
    Object_6: THREE.Mesh;
    Object_7: THREE.Mesh;
  };
  materials: {
    blue: THREE.MeshStandardMaterial;
    ["blue-trousers"]: THREE.MeshStandardMaterial;
    green: THREE.MeshStandardMaterial;
    red_chamise: THREE.MeshStandardMaterial;
    ["red_chamise-dark"]: THREE.MeshStandardMaterial;
    ["dark-red-button"]: THREE.MeshStandardMaterial;
  };
};

export function Model(props: JSX.IntrinsicElements["group"]) {
  const { nodes, materials } = useGLTF("/scene.gltf") as GLTFResult;
  return (
    <group {...props} dispose={null}>
      <group rotation={[-Math.PI / 2, 0, 0]}>
        <mesh geometry={nodes.Object_2.geometry} material={materials.blue} />
        <mesh
          geometry={nodes.Object_3.geometry}
          material={materials["blue-trousers"]}
        />
        <mesh geometry={nodes.Object_4.geometry} material={materials.green} />
        <mesh
          geometry={nodes.Object_5.geometry}
          material={materials.red_chamise}
        />
        <mesh
          geometry={nodes.Object_6.geometry}
          material={materials["red_chamise-dark"]}
        />
        <mesh
          geometry={nodes.Object_7.geometry}
          material={materials["dark-red-button"]}
        />
      </group>
    </group>
  );
}

useGLTF.preload("/scene.gltf");

export default Model;
